import { Box, Button, Stack, Tab, Tabs, Typography } from '@mui/material';
import * as React from 'react';
import { useNavigate } from 'react-router-dom';

const UserInfo: React.FC = () => {
    const navigate = useNavigate();

    const goPwUpdate = () => {
        navigate('/pwupdate')
    };
    const goUserInfo = () => {
        navigate('/userinfo')
    };
    const goBookmark = (state: number) => {
        navigate('/bookmark',  { state: state })
    };
    const goResume = (state: number) => {
        navigate('/resume',  { state: state })
    };
    const goManage = (state: number) => {
        navigate('/manage',  { state: state })
    };

    function a11yProps(index: number) {
    return {
        id: `simple-tab-${index}`,
        'aria-controls': `simple-tabpanel-${index}`,
    };
    }
    const handleChange = (event: React.SyntheticEvent, newValue: number) => {
        setValue(newValue);
      };
    const [value, setValue] = React.useState(0);

    return (
        <div className='userinfo'>
            <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
                <Tabs value={value} onChange={handleChange} aria-label="basic tabs example">
                    <Tab label="회원정보" {...a11yProps(0)} onClick={() => { goUserInfo(); } }/>
                    <Tab label="북마크" {...a11yProps(1)} onClick={() => { goBookmark(1); } }/>
                    <Tab label="이력서" {...a11yProps(2)} onClick={() => { goResume(2); } } />
                    <Tab label="자소서 관리" {...a11yProps(3)} onClick={() => { goManage(3); } } />
                </Tabs>
            </Box>
            <Box sx={{ display: 'flex',position:'relative', width:550, height: 450, margin:'auto', textAlign:'center', border: 1, borderRadius: 5, backgroundColor:'#ffffff', flexDirection: 'column',mt:5, padding: 5 }} >    
                <Typography sx={{fontSize: 32, pb:3 }}>회원 정보</Typography>
                <Stack  direction="row" spacing={2} alignItems="center"sx={{px:5}}> 
                    <Stack direction="column">
                        <Stack  direction="row" spacing={2} alignItems="center" sx={{py:2}} >
                            <Typography sx={{fontSize: 20 }}>아이디 :</Typography>
                            <Typography sx={{fontSize: 20 }}>Test1</Typography>
                        </Stack>
                        <Stack  direction="row" spacing={2} alignItems="center" sx={{py:2}} >
                            <Typography sx={{fontSize: 20 }}>비밀번호 :</Typography>
                            <Button variant="outlined"  size="small" sx={{ width: 100, mt:3, mx:'auto', color:'#ffff', backgroundColor: '#5856D6', borderColor:'#434343'}} onClick={() => { goPwUpdate() }}>
                                비밀번호 변경
                            </Button>
                        </Stack>
                        <Stack  direction="row" spacing={2} alignItems="center" sx={{py:2}}>
                            <Typography sx={{fontSize: 20 }}>이름 :</Typography>
                            <Typography sx={{fontSize: 20 }}>Test1</Typography>
                        </Stack>
                        <Stack  direction="row" spacing={2} alignItems="center" sx={{py:2}} >
                            <Typography sx={{fontSize: 20 }}>이메일 :</Typography>
                            <Typography sx={{fontSize: 20 }}>Test1 @yogiup.com</Typography>
                        </Stack>
                    </Stack>    
                    <Box>
                        <img src="/Users/frida/YGUP/frontend/src/img/apple.gif" sizes="nomal" />
                    </Box>
                </Stack>
                <br/>
                <Button variant="outlined"  size="small" sx={{ width: 100, mt:3, mx:'auto', color:'#ffff', backgroundColor: '#5856D6', borderColor:'#434343'}} >
                    회원정보 수정
                </Button>
            </Box>
        </div>
    );
}
export default UserInfo;
